import React from 'react';
import './Experience.css';

const Experience = () => {
  return (
    <div className="experience-container">
      <h1 id='exph1'>Experience</h1>
      <ul>
        <li className="experience-item">
          <h2>Software Developer</h2>
          <p id = 'Cname'>Cha-Chi Communications Pvt. Ltd. | Jan 2020 - Present</p>
          <p>Worked on developing and maintaining web applications using React and Node.js.</p>
        </li>
        <li className="experience-item">
          <h2>Technology Process Trainee</h2>
          <p id = 'Cname'>Ameriprise Financial | Mar 2022 - Dec 2022</p>
          <p>Focused on creating responsive and interactive user interfaces with HTML, CSS, and JavaScript.</p>
        </li>
      </ul>
    </div>
  );
}

export default Experience;
